import React from "react";
import styled from "styled-components";

const CardImage = styled("img")`
  border-radius: 10px 10px 0px 0px;
  margin: 0;
  height: 230px;
  width: 100%;
`;

const Info = ({info}) => {
    return (
        <>
        <CardImage src="../../assets/images/contactus_img.svg"/>



        </>
    );
}

export default MapViewer;
